import React from "react";
import "./Navbar.css";
export default function Navbar() {
  return (
    <nav>
    <ul class="nav__links">
        <li><a href="#">Services</a></li>
        <li><a href="#">Projects</a></li>
        <li><a href="#">About</a></li>
    </ul>
</nav>
  );
}
